import  "./crew.css"
import CartoonOne from '../../assets/img/cartoon-one.png';
// import CartoonTwo from '../../assets/img/cartoon-two.png';
// import CartoonThree from '../../assets/img/cartoon-three.png';



const Crew = () => {
    return (
        <div className="crew" id="the-crew">
            <div className="section">

                <div className="one">

                    <div className="image">
                    <img src={CartoonOne} alt="The Void logo" className="gallery"></img>
                    </div>

                    <div className="crew-names">
                        <span>Captain</span>
                        <span>Eric</span>
                    </div>

                </div>


                <div className="two">

                </div>
                <div className="three">

                </div>
            </div>
        </div>
    )
}

export default Crew
